	(6185, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я конфискую украденное зерно, предупрежу преступника о том, что воровство – путь к беде и разрушению, и отпущу его к семье.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6185, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я отдам ему столько зерна, чтобы он мог прокормить свою семью пару дней, и посоветую ему покинуть наши земли.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я исполню веление моего господина. Его смерть будет долгой и мучительной, ибо он совершил преступление против моего народа.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я казню его, как приказал мой господин, но сделаю это по возможности быстро и безболезненно. Правосудие правосудием, но зверства тут ни к чему.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6211, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я бы хотел получить такое предсказание. В моих сумках найдется место.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я рискну собственной жизнью и освобожу его, чтобы он мог доказать свою невиновность. Я помогу другу всем, чем смогу.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
